export default () => (
  <header>
    <nav>
      <h1>Killerpedia</h1>
      <div className="menu">
        <div>Browse by:</div>
        <ul>
          <li>Male</li>
          <li>Female</li>
          <li>Country</li>
        </ul>
      </div>
      <style jsx>{`
        nav {
          max-width: 1400px;
          margin: 0 auto;
          display: flex;
          align-items: center;
          justify-content: space-between;
        }

        ul {
          // display: flex;
        }

        h1 {
          font-size: 2rem;
          margin: 4px 0;
        }
      `}</style>
    </nav>
  </header>
);
